<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN"
    "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">

<html xmlns="http://www.w3.org/1999/xhtml"
	xmlns:wicket="http://wicket.sourceforge.net/" xml:lang="en" lang="en">

<wicket:head>
	<link wicket:id="reportStyle" rel="stylesheet" type="text/css" href="style/reportStyle.css" />
</wicket:head>

<body>

<wicket:panel>
	<div wicket:id="blueFrame">
		<table cellpadding="0" cellspacing="0" style="margin-top: -10px">
			<tr>
				<td width="5">&nbsp;</td>
				<td>
		
					<table class="reportTable" cellpadding="0" cellspacing="0">
						<tr>
							<th wicket:id="columnHeaders"></th>
						</tr>
						
						<span wicket:id="reportData">
						
							<tr class="dataRow" wicket:id="row">
								<td wicket:id="cell"></td>
							</tr>
						</span>
					</table>
				</td>
			</tr>
		</table>
	</div>
</wicket:panel>

</body>

</html>
